import React from 'react'
import classes from './ImageHeader.module.css'

const ImageHeader = () => {
    return (
        <div>
        <div className={classes.imageSection}>
                <button className={classes.bookNow}>Book Now</button>
        </div>
        </div>
    )
}

export default ImageHeader
